/*

1679. Max Number of K-Sum Pairs

You are given an integer array nums and an integer k.

In one operation, you can pick two numbers from the array whose sum equals k and remove them from the array.

Return the maximum number of operations you can perform on the array.

 

Example 1:

Input: nums = [1,2,3,4], k = 5
Output: 2
Explanation: Starting with nums = [1,2,3,4]:
- Remove numbers 1 and 4, then nums = [2,3]
- Remove numbers 2 and 3, then nums = []
There are no more pairs that sum up to 5, hence a total of 2 operations.
Example 2:

Input: nums = [3,1,3,4,3], k = 6
Output: 1
Explanation: Starting with nums = [3,1,3,4,3]:
- Remove the first two 3's, then nums = [1,4,3]
There are no more pairs that sum up to 6, hence a total of 1 operation.
 

Constraints:

1 <= nums.length <= 105
1 <= nums[i] <= 109
1 <= k <= 109
*/

/**
 * @param {number[]} nums
 * @param {number} k
 * @return {number}
 */
const maxOperations = function(nums, k) {
    let numsSet = {}
    let counter = 0

    for(num of nums) {
        // Calculate the second number
        let x = k - num

        // If there is a Set element containing the value which is greater than 0, increase the sum counter and reduce the element counter in set
        if(numsSet[x] > 0) {
            counter++
            numsSet[x]--
        } else {
            // If set with the number key exists, increase the number counter, otherwise create the key and set the value to 1
            numsSet[num] ? numsSet[num]++ : numsSet[num] = 1
        }
    }

    return counter
};

